    <p>Marabina James is an American born Mexi-Rican actress, singer, writer/ producer, and Emmy Award® Winning Host. She is the co-host and co-producer of The Trend Talk Show with Bel Hernandez on various platforms. One of the most versatile Bilingual voices working today, you've seen or heard her on national commercial campaigns, <br> <br>TV network promos, animation, ADR, and narration. Marabina, best known as "Mara" from PBS' "Storytime!", has voiced cartoons, video games, and animated features including: Carmen in KlaskyCsupo's Santo Bugito, Lilandra in Marvel Ultimate Alliance, Gina Hunter in The Omega Strain, Coco, and Spies In Disguise On Camera guest star credits include East Los High, Criminal Minds, and Showtime's SMILF. Ms. Jaimes narrates and is highlighted in the critically acclaimed documentary, "Now En Español" (PBS/Voces) about voicing Mary Alice on "Desperate Housewives" en Español, the world of dubbing, and the trials and tribulations of LatinX Actresses in Hollywood.</p>
